import React from 'react';
import Navbar from '../Navbar';
import Blogs from '../Blogs';
import Footer from '../Footer';

const Blog2 = () => {
  return (
    <>
        <Navbar/>
        <Blogs/>
        <Footer/>
    </>
  )
}

export default Blog2;
